BEGIN TRANSACTION;
CREATE TABLE "Fityfeed_category" ("id" SERIAL PRIMARY KEY, "name" varchar(100) NOT NULL);
CREATE TABLE "Fityfeed_customer" ("id" SERIAL PRIMARY KEY, "name" varchar(100) NOT NULL, "email" varchar(200) NOT NULL, "calorie_limit" real NULL, "user_id" BIGINT NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "activity_level" varchar(10) NOT NULL, "age" BIGINT NOT NULL, "goal" varchar(10) NOT NULL, "height" BIGINT NOT NULL, "weight" BIGINT NOT NULL, "calorie_intake" BIGINT NOT NULL, "calorie_goal" varchar(100) NOT NULL, "daily_intake" real NULL, "gender" varchar(10) NOT NULL, "calorie_needs" BIGINT NULL);
CREATE TABLE "Fityfeed_exercise" ("id" SERIAL PRIMARY KEY, "name" varchar(255) NOT NULL, "time" time NOT NULL, "calorie" BIGINT NOT NULL, "user_id" BIGINT NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Fityfeed_fooditem" ("id" SERIAL PRIMARY KEY, "name" varchar(100) NOT NULL, "meal_type" varchar(20) NOT NULL, "calories" BIGINT NOT NULL CHECK ("action_flag" >= 0) CHECK ("calories" >= 0), "carbohydrate" real NOT NULL, "fats" real NOT NULL, "protein" real NOT NULL, "category_id" BIGINT NOT NULL REFERENCES "Fityfeed_category" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Fityfeed_meal" ("id" SERIAL PRIMARY KEY, "date" date NOT NULL, "customer_id" BIGINT NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Fityfeed_meal_fooditems" ("id" SERIAL PRIMARY KEY, "meal_id" BIGINT NOT NULL REFERENCES "Fityfeed_meal" ("id") DEFERRABLE INITIALLY DEFERRED, "fooditem_id" BIGINT NOT NULL REFERENCES "Fityfeed_fooditem" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Fityfeed_userfooditem" ("id" SERIAL PRIMARY KEY, "customer_id" BIGINT NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Fityfeed_userfooditem_fooditem" ("id" SERIAL PRIMARY KEY, "userfooditem_id" BIGINT NOT NULL REFERENCES "Fityfeed_userfooditem" ("id") DEFERRABLE INITIALLY DEFERRED, "fooditem_id" BIGINT NOT NULL REFERENCES "Fityfeed_fooditem" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "Fityfeed_userprofile" ("id" SERIAL PRIMARY KEY, "bio" text NOT NULL, "profile_picture" varchar(100) NULL, "user_id" BIGINT NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "calorie_needs" BIGINT NULL);
CREATE TABLE "auth_group" ("id" SERIAL PRIMARY KEY, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE "auth_group_permissions" ("id" SERIAL PRIMARY KEY, "group_id" BIGINT NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" BIGINT NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_permission" ("id" SERIAL PRIMARY KEY, "content_type_id" BIGINT NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE "auth_user" ("id" SERIAL PRIMARY KEY, "password" varchar(128) NOT NULL, "last_login" TIMESTAMP NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" TIMESTAMP NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE "auth_user_groups" ("id" SERIAL PRIMARY KEY, "user_id" BIGINT NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" BIGINT NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_user_user_permissions" ("id" SERIAL PRIMARY KEY, "user_id" BIGINT NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" BIGINT NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "django_admin_log" ("id" SERIAL PRIMARY KEY, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint NOT NULL CHECK ("action_flag" >= 0) CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" BIGINT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" BIGINT NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" TIMESTAMP NOT NULL);
CREATE TABLE "django_content_type" ("id" SERIAL PRIMARY KEY, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE "django_migrations" ("id" SERIAL PRIMARY KEY, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" TIMESTAMP NOT NULL);
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" TIMESTAMP NOT NULL);
